import React from "react";
import "../Home Page/Homepage.css"
import vaidhyalogo from "../images/vaidhya_header_img.jpg"

function DoctorHeader(){
    return(
        <div>
            <header className="nav">
                <ul className="navheader">
                    To-do
                    NewPatient
                    Staff
                    Billing
                </ul>
            </header>
        </div>
    )
}
export default DoctorHeader;
